import './App.css';
import DashBoard from './components/DashBoard';
import Header from './components/Header';
import SideBar from './components/SideBar'
function App() {
  return (
    <div className="App">
      <body>
      <Header></Header>
      <main>

      <SideBar></SideBar>
        <DashBoard></DashBoard>
      </main>
      </body>
    </div>
  );
}

export default App;
